<head>
    <meta charset="UTF-8">
    <meta name="viewport" content="width=device-width, initial-scale=1.0">
    <title>BloxGPT</title>
    <link rel="icon" type="image/x-icon" href="logo.jpg">
    <script src="b3c80fe252.js" crossorigin="anonymous"></script>
    <link rel="stylesheet" href="ajax/libs/font-awesome/6.4.0/css/all.min.css">
    <style>
        * {
            box-sizing: border-box;
        }

        body {
            margin: 0px;
            font-family: 'segoe ui';
        }

        .nav {
            height: 50px;
            width: 100%;
            background-color: #000000;
            position: relative;
        }

        .nav > .nav-header {
            display: inline;
        }

        .nav-logo {
            width: 40px; /* Adjust the width of the logo as needed */
            margin-right: 10px; /* Add some margin for spacing */
            margin:0 auto;
            left: 50%;
            position: absolute;
            transform: translateX(-50%);
            margin-top:4px;

        }

        .nav > .nav-header > .nav-title {
            display: inline-block;
            font-size: 22px;
            color: #fff;
            padding: 10px 10px 10px 10px;
            font-family:'Franklin Gothic Medium', 'Arial Narrow', Arial, sans-serif
        }

        .nav > .nav-btn {
            display: none;
        }

        .nav > .nav-links {
            display: inline;
            float: right;
            font-size: 18px;
        }

        .nav > .nav-links > a {
            display: inline-block;
            padding: 13px 10px 13px 10px;
            text-decoration: none;
            color: #efefef;
        }

        .nav > .nav-links > a:hover {
            background-color: rgba(0, 0, 0, 0.3);
        }

        .nav > #nav-check {
            display: none;
        }

        @media (max-width:600px) {
            .nav > .nav-btn {
                display: inline-block;
                position: absolute;
                right: 0px;
                top: 0px;
            }
            .nav > .nav-btn > label {
                display: inline-block;
                width: 50px;
                height: 50px;
                padding: 13px;
            }
            .nav > .nav-btn > label:hover,.nav  #nav-check:checked ~ .nav-btn > label {
                background-color: rgba(0, 0, 0, 0.3);
            }
            .nav > .nav-btn > label > span {
                display: block;
                width: 25px;
                height: 10px;
                border-top: 2px solid #eee;
            }
            .nav > .nav-links {
                position: absolute;
                display: block;
                width: 100%;
                background-color: #000000;
                height: 0px;
                transition: all 0.3s ease-in;
                overflow-y: hidden;
                top: 50px;
                left: 0px;
            }
            .nav > .nav-links > a {
                display: block;
                width: 100%;
            }
            .nav > #nav-check:not(:checked) ~ .nav-links {
                height: 0px;
            }
            .nav > #nav-check:checked ~ .nav-links {
                height: calc(100vh - 50px);
                overflow-y: auto;
            }
        }

        body {
            font-family: Arial, sans-serif;
            background-color: #f8f9fa;
            margin: 0;
            padding: 0;
            display: flex;
            flex-direction: column;
            min-height: 100vh;
        }

        .content {
            flex-grow: 1;
            padding-top: 20px;
            padding-bottom: 100px;
            font-size: 17px;
        }

        .chat {
            position: fixed;
            bottom: 0;
            left: 0;
            width: 100%;
            background-color: #fff;
            border-radius: 10px 10px 0 0;
            box-shadow: 0 -4px 10px rgba(0, 0, 0, 0.1);
            overflow: hidden;
            z-index: 999;
        }

        .chat-box {
            max-height: calc(100vh - 200px);
            overflow-y: auto;
            padding: 20px;
            margin-bottom: auto;
        }

        .chat-input {
            padding: 20px;
            background-color: #f1f1f1;
            display: flex;
        }

        .chat-input input[type="text"] {
            flex: 1;
            padding: 10px;
            border-radius: 5px;
            border: none;
            outline: none;
            font-size: 16px;
        }

        .send-icon {
            padding: 10px;
            background-color: #007bff;
            color: #fff;
            cursor: pointer;
            font-size: 16px;
        }

        .send-icon:hover {
            background-color: #0056b3;
        }

        .message {
            margin-bottom: 10px;
            margin-left: 8px;
        }

        .spinner {
            text-align: center;
        }

        .spinner i {
            font-size: 32px; /* Adjust the font size as needed */
        }

        .message.bot-message {
            margin-top: 20px; /* Space between bot message and previous message */
            margin-bottom: 20px;
            margin-left: 6px;
        }

        .message .bot-name {
            font-weight: bold;
        }

        a { color: inherit; }
